import './CSS/ExpenseItem.css'

const ExpenseItem = () => {
  return (
    <div>
      <div className="">July 14th 2022</div>
      <div>
        <h2>New Tv</h2>
        <div>$500</div>
      </div>
    </div>
  );
};

export default ExpenseItem;
